import "./App.css";

function App() {
  return (
    <header className="App-header">
      <div className="App">
        <form>
          <label htmlFor="username">Username:</label>
          <input
            type="text"
            id="username"
            name="username\"
            onChange={(e) => console.log(e.target.value)}
          />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password\" />
        </form>
      </div>
    </header>
  );
}

export default App;
